import '../App.css'
import '../bootstrap.min.css'
import React, { useState } from "react";

function Album(props) {
    return (
        <div className={"floatin"}>
            <img className={"album"} src={"./Earth/dark.jpg"}/>
            <span className={"text-white titulo"}>
                <div>
                    <h4 className={"nunito"}>Dark Side of The Moon</h4>
                    <p className={"nunito"}>Pink Floyd</p>
                </div>
            </span>


        </div>
    );
}

export default Album
